      integer ieta, ixi, j

      real*8 ff(nxi*neta),rlambda(nxi+4),rmu(neta+4),c(nxi*neta),
     ,       wrk((nxi+6)*(neta+6)),xx(1),yy(1),fg(1)
      integer i,ipeta,ipxi,ifail,iwrk(neta),init
      data init/0/
