     # -3d0, -2.83333333d0, -2.66666667d0, -2.5d0, -2.33333333d0,
     # -2.16666667d0, -2d0, -1.83333333d0, -1.66666667d0, -1.5d0, 
     # -1.33333333d0, -1.16666667d0, -1d0, -0.83333333d0, -0.66666667d0, 
