     #  2.83333333d0, 3d0, 3.16666667d0, 3.33333333d0, 3.5d0, 
     #  3.66666667d0, 3.83333333d0, 4d0, 4.16666667d0, 4.33333333d0, 
     #  4.5d0, 4.66666667d0, 4.83333333d0, 5d0/

