     #  5.33333333d0, 5.5d0, 5.66666667d0, 5.83333333d0, 6d0/

      data (dlaxi(j), j = 1,nxi) /
     #  0.66666667d0, 0.83333333d0, 1d0, 
     #  1.16666667d0, 1.33333333d0, 1.5d0, 1.66666667d0, 1.83333333d0,
